import {
	Button,
	FormControl,
	FormLabel,
	Input,
	Select,
	VStack,
} from "@chakra-ui/react";

function CourseForm() {
	return (
		<FormControl>
			<VStack>
				<FormLabel>Name</FormLabel>
				<Input></Input>
				<FormLabel>Description</FormLabel>
				<Input></Input>
				<FormLabel>Other Teachers</FormLabel>
				<Select key="type" placeholder="Select Other Teachers"></Select>
				<Button type="submit">Submit</Button>
			</VStack>
		</FormControl>
	);
}

export default CourseForm;
